import './App.css';
import React from 'react';
import Row from './Row';
import requests from './requests';
//import { requests from 'express';

function App() {
  return (
    <div className="App">
     <h1>test run</h1>
     <Row title = "Tending Now" fetchUrl={requests.fetchTrending}/>
     <Row title = "Top Rated" fetchUrl={requests.fetchTrending}/>
     <Row title = "Action movies" fetchUrl={requests.fetchTrending}/>
     <Row title = "comedy" fetchUrl={requests.fetchTrending}/>
     <Row title = "Teh" fetchUrl={requests.fetchTrending}/>


    </div>
  );
}

export default App;
